import React from 'react';
import Header from './common/Header';
// import Footer from './common/Footer';

const Home = () => {
  return (
    <div className="Container">
      <Header />
      <div className="Body">
        <div className="row">
          <div className="col-sm-6">
            left
          </div>
          <div className="col-sm-6">
            right
        </div>
        </div>
      </div>
      {/* <Footer /> */}
    </div>
  );
};
export default Home;
